<!DOCTYPE html>
<html lang="en">
<head>
    <?php $sitetitle = print $host; ?>;
	<title><?php print $host; ?></title>
	<link rel="icon" type="image/png" href="logo.png">
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title><?php echo $sitetitle; ?></title>
    <style>
        /* Algemene styling */
        body {
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0;
            background-color: #f9f9f9;
            color: #333;
        }

        header {
            background-color: #007bff;
            color: white;
            text-align: center;
            padding: 1.5em 0;
            box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
            margin-bottom: 1.5em;
        }

        main {
            display: flex;
            flex-direction: column;
            align-items: center;
            width: 90%;
            max-width: 1200px;
            margin: 0 auto;
        }

        table {
            width: 100%;
            border-collapse: collapse;
            background-color: #fff;
            box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
            border-radius: 8px;
            margin-bottom: 1em;
        }

        th, td {
            padding: 0.75em;
            text-align: center;
            border: 1px solid #ddd;
        }

        th {
            background-color: #007bff;
            color: white;
            text-transform: uppercase;
        }

        tr:nth-child(even) {
            background-color: #f9f9f9;
        }

        tr:nth-child(odd) {
            background-color: #fff;
        }

        tr:hover {
            background-color: #f1f1f1;
        }

        .chart-container {
            width: 100%;
            display: flex;
            flex-wrap: wrap;
            justify-content: space-around;
            margin-top: 1.5em;
        }

        canvas {
            margin: 1em;
            width: 45%;
            max-width: 400px;
            height: auto;
        }

        /* Dropdown styling voor filters */
        .filter-header {
            display: flex;
            justify-content: space-around;
            margin-bottom: 1em;
            flex-wrap: wrap;
        }

        .filter-header select {
            padding: 0.5em;
            margin: 0.5em;
            border: 1px solid #ddd;
            border-radius: 4px;
            font-size: 1em;
        }
    </style>
</head>
<body>
    <header>
        <h1><?php echo $sitetitle; ?></h1>
    </header>
    <main>
        <!-- Filters -->
        <div class="filter-header">
            <select id="ipFilter" multiple>
                <option value="">Filter op IP Adres</option>
            </select>
            <select id="ispFilter" multiple>
                <option value="">Filter op ISP</option>
            </select>
            <select id="cityFilter" multiple>
                <option value="">Filter op Stad</option>
            </select>
            <select id="countryFilter" multiple>
                <option value="">Filter op Land</option>
            </select>
            <select id="continentFilter" multiple>
                <option value="">Filter op Continent</option>
            </select>
            <select id="dateFilter" multiple>
                <option value="">Filter op Datum</option>
            </select>
        </div>

        <!-- Tabel -->
        <table id="data-table">
            <thead>
                <tr>
                    <th>IP Adres</th>
                    <th>ISP</th>
                    <th>Stad</th>
                    <th>Land</th>
                    <th>Continent</th>
                    <th>Datum</th>
                    <th>Tijd</th>
                </tr>
            </thead>
            <tbody id="table-body">
                <?php
                if (file_exists('ip.txt')) {
                    $lines = file('ip.txt', FILE_IGNORE_NEW_LINES | FILE_SKIP_EMPTY_LINES);

                    foreach ($lines as $line) {
                        preg_match_all('/:\s*([^|]+)/', $line, $matches);
                        if (!empty($matches[1])) {
                            echo '<tr>';
                            echo '<td>' . htmlspecialchars(trim($matches[1][0])) . '</td>'; // IP-adres
                            echo '<td>' . htmlspecialchars(trim($matches[1][4])) . '</td>'; // ISP
                            echo '<td>' . htmlspecialchars(trim($matches[1][2])) . '</td>'; // Stad
                            echo '<td>' . htmlspecialchars(trim($matches[1][3])) . '</td>'; // Land
                            echo '<td>' . htmlspecialchars(trim($matches[1][1])) . '</td>'; // Continent
                            echo '<td>' . htmlspecialchars(trim($matches[1][6])) . '</td>'; // Datum
                            echo '<td>' . htmlspecialchars(trim($matches[1][7])) . '</td>'; // Tijd
                            echo '</tr>';
                        }
                    }
                } else {
                    echo '<tr><td colspan="7">Geen gegevens gevonden.</td></tr>';
                }
                ?>
            </tbody>
        </table>

        <!-- Grafieken -->
        <div class="chart-container">
            <canvas id="continentChart"></canvas>
            <canvas id="countryChart"></canvas>
            <canvas id="cityChart"></canvas>
            <canvas id="ispChart"></canvas>
            <canvas id="dateChart"></canvas>
            <canvas id="timeChart"></canvas>
        </div>
    </main>
    <script>
        const tableBody = document.querySelector('#table-body');
        const rows = Array.from(tableBody.querySelectorAll('tr'));

        function getColumnData(columnIndex) {
            return rows.map(row => row.children[columnIndex].textContent.trim());
        }

        function populateFilters() {
            const filters = {
                ipFilter: getColumnData(0),
                ispFilter: getColumnData(1),
                cityFilter: getColumnData(2),
                countryFilter: getColumnData(3),
                continentFilter: getColumnData(4),
                dateFilter: getColumnData(5),
            };

            for (const [filterId, options] of Object.entries(filters)) {
                const filter = document.getElementById(filterId);
                options.forEach(option => {
                    const opt = document.createElement('option');
                    opt.value = option;
                    opt.textContent = option;
                    filter.appendChild(opt);
                });
            }
        }

        function updateCharts() {
            const continents = getColumnData(4);
            const countries = getColumnData(3);
            const cities = getColumnData(2);
            const isps = getColumnData(1);
            const dates = getColumnData(5);
            const times = getColumnData(6);

            createChart('continentChart', [...new Set(continents)], continents.map(() => 1), 'Continenten');
            createChart('countryChart', [...new Set(countries)], countries.map(() => 1), 'Landen');
            createChart('cityChart', [...new Set(cities)], cities.map(() => 1), 'Steden');
            createChart('ispChart', [...new Set(isps)], isps.map(() => 1), 'ISPs');
            createChart('dateChart', [...new Set(dates)], dates.map(() => 1), 'Datums');
            createChart('timeChart', [...new Set(times)], times.map(() => 1), 'Tijden');
        }

        function createChart(canvasId, labels, data, label) {
            const ctx = document.getElementById(canvasId).getContext('2d');
            return new Chart(ctx, {
                type: 'bar',
                data: {
                    labels: labels,
                    datasets: [{
                        label: label,
                        data: data,
                        backgroundColor: 'rgba(75, 192, 192, 0.5)',
                        borderColor: 'rgba(75, 192, 192, 1)',
                        borderWidth: 1
                    }]
                },
                options: {
                    responsive: true,
                    scales: {
                        y: { beginAtZero: true }
                    }
                }
            });
        }

        populateFilters();
        updateCharts();
    </script>
